import { colors } from '@material-ui/core';

const white = '#FFFFFF';
const black = '#000000';
const rebeccapurple = '#663399'; // Color code for rebeccapurple

const palette = {
  black,
  white,
  primary: {
    contrastText: white,
    dark: colors.rebeccapurple[900], // Dark shade of rebeccapurple
    main: colors.rebeccapurple[700], // Main shade of rebeccapurple
    light: colors.rebeccapurple[100] // Light shade of rebeccapurple
  },
  secondary: {
    contrastText: white,
    dark: colors.rebeccapurple[900], // Dark shade of rebeccapurple
    main: colors.rebeccapurple['A400'], // Main shade of rebeccapurple
    light: colors.rebeccapurple['A400'] // Light shade of rebeccapurple
  },
  error: {
    contrastText: white,
    dark: colors.red[900],
    main: colors.red[600],
    light: colors.red[400]
  },
  text: {
    primary: colors.blueGrey[900],
    secondary: colors.blueGrey[600],
    link: colors.blue[600]
  },
  link: colors.blue[800],
  icon: colors.blueGrey[600],
  background: {
    default: '#F4F6F8',
    paper: white
  },
  divider: colors.grey[200]
};

export default palette;
